const Reducer = (state, action) => {
	switch (action.type) {
		case 'UPDATE_ERROR':
			const errorList = action.payload
			errorList.forEach((element) => {
				state.push(element)
			})
			return state
		default:
			return [...state]
	}
}
export default Reducer
